import React from "react"
import ReactDOMClient from "react-dom/client"
import './index.css'
//import { UPL } from './userpage.js'
//import { VideoChat } from './videochat.js'

function MainPage() {
  return (
    <div>
      <h1>Главная страница</h1>
      <p onClick={SetLogin}>Вход</p>
      <p onClick={SetReg}>Регистрация</p>
    </div>
  )
}

function SetMainPage() {
  app.render(<MainPage />)
}

function Login() {
  return (
    <form className="box" action="/" method="post" id="mainform">
      <h1>Вход</h1>
      <p onClick={SetReg}>Регистрация</p>
      <p onClick={SetMainPage}>Главная</p>
      <input type="text" name="login" placeholder="Логин" id="l" />
      <input type="password" name="password" placeholder="Пароль" id="p" />
      <input type="button" name="do_login" value="Войти" onClick={loginFunc} />
    </form>
  );
}

function SetLogin() {
  app.render(<Login />)
}

function Reg() {
  return (
    <form className="box" action="/" method="post" id="mainform">
      <h1>Регистрация</h1>
      <p onClick={SetLogin}>Вход</p>
      <p onClick={SetMainPage}>Главная</p>
      <input type="text" name="login" placeholder="Логин" id="login" />
      <input type="password" name="password1" placeholder="Пароль" id="password1" />
      <input type="password" name="password2" placeholder="Пароль повтор" id="password2" />
      <input type="button" name="do_reg" value="Зарегистрироваться" onClick={regFunc} />
    </form>
  );
}

function SetReg() {
  app.render(<Reg />)
}

function regFunc() {
  let login = document.getElementById("login").value;
  let password1 = document.getElementById("password1").value;
  let password2 = document.getElementById("password2").value;

  const request = new XMLHttpRequest();

  const url = "http://localhost:8080/Reg";

  const params = "login=" + login + "&password1=" + password1 + "&password2=" + password2;

  request.open("POST", url, true);

  request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

  request.addEventListener("readystatechange", () => {

    if (request.readyState === 4 && request.status === 200) {
      //if (request.responseText === "true") {
      //app.render(<VideoChat />)
      console.log(request.responseText);
      //}
    }
  });

  request.send(params);
}

function loginFunc() {
  let l = document.getElementById("l").value;
  let p = document.getElementById("p").value;

  const request = new XMLHttpRequest();

  const url = "http://localhost:8080/Login";

  const params = "login=" + l + "&password=" + p;

  request.open("POST", url, true);

  request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

  request.addEventListener("readystatechange", () => {

    if (request.readyState === 4 && request.status === 200) {
      //if (request.responseText === "true") {
      //app.render(<VideoChat />)
      console.log(request.responseText);
      document.cookie = "login=" + l + ";max-age=3600";
      document.cookie = "password=" + p + ";max-age=3600";
      const app = ReactDOMClient.createRoot(document.getElementById("app"))
      app.render(<SetUserPage />)
      //}
    }
  });

  request.send(params);
}

function getCookie(cname) {
  var name = cname + "=";
  var ca = document.cookie.split(';');
  for (var i = 0; i < ca.length; i++) {
    var c = ca[i];
    while (c.charAt(0) === ' ') {
      c = c.substring(1);
    }
    if (c.indexOf(name) === 0) {
      return c.substring(name.length, c.length);
    }
  }
  return "";
}

function UserPageLoad(ul, utn, uts, utc) {
  return (
      <div>
          <h1>Личный кабинет</h1>
          <p id="ul">Ваш логин: {ul}</p>
          <p id="utn">Ваш тариф: {utn}</p>
          <p id="uts">Скорость тарифа: {uts}</p>
          <p id="utc">Стоимость тарифа: {utc}</p>
      </div>
  )
}

function SetUserPage() {

  const request = new XMLHttpRequest();

  const url = "http://localhost:8080/lk";

  const params = "login=" + getCookie("login") + "&password=" + getCookie("password");

  request.open("POST", url, true);

  request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

  request.addEventListener("readystatechange", () => {

    if (request.readyState === 4 && request.status === 200) {
      console.log(request.responseText);
      const obj = JSON.parse(request.responseText);
      app.render(UserPageLoad(obj.Name));
    }
  });

  request.send(params);
}

const app = ReactDOMClient.createRoot(document.getElementById("app"))

app.render(<SetMainPage />)
